  [],\n\t\"revision_timestamp\": \"2016-02-27T17:19:04.589034\",\n\t\"name\": \"enumeration-verification-system-evs\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"EVS is a batch application that processes
  for federal, state, local and foreign government agencies, private companies and
  internal SSA customers and systems. Each user is assigned a Verification Account
  Number (VAN) and a Processing Code (PC). The assigned PC (and sometimes the PC-VAN
  combination) determines the type of verification routine that will be performed
  for each user. The input record passes through the EVS SSN verification process
  with the goal of verifying that the SSN is valid and the corresponding name, DOB
  and/or gender match with certain tolerances. The EVS verification response codes
  are returned to the requester.Future - EVS will eventually be replaced by DEVO.\",\n\t\"license_title\":
